module stopwatch
(
  input  wire       clk, rst, go,  up,
  output wire [3:0] d3,  d2,  d1,  d0
);

// counter
reg counter_rst;
wire max_tick;
counter counter_inst(.clk(clk), .rst(counter_rst), .max_tick(max_tick));

// state reg logic
parameter S0 = 2'b00,
          S1 = 2'b01,
          S2 = 2'b10,
          S3 = 2'b11;

reg [1:0] current_state, next_state;
reg [9:0] _1s_counter_current, _10s_counter_current, _60s_counter_current, _1m_counter_current;
reg [9:0] _1s_counter_next, _10s_counter_next, _60s_counter_next,_1m_counter_next;

always @(posedge clk)
begin
  if (rst)
  begin
    current_state <= S0;
    _1s_counter_current  <= 0;
    _10s_counter_current <= 0;
    _60s_counter_current <= 0;
    _1m_counter_current  <= 0;
  end
  else
  begin
    current_state <= next_state;
    _1s_counter_current  <= _1s_counter_next;
    _10s_counter_current <= _10s_counter_next;
    _60s_counter_current <= _60s_counter_next;
    _1m_counter_current  <= _1m_counter_next;
  end
end

// next state logic
always @*
begin
  _1s_counter_next  = _1s_counter_current;
  _10s_counter_next = _10s_counter_current;
  _60s_counter_next = _60s_counter_current;
  _1m_counter_next  = _1m_counter_current;
  case(current_state)
    S0:
    begin
      counter_rst = 1'b1;
      next_state = go && up ? S1 : go && !up ? S2 : S0;
    end
    S1:
    begin
      counter_rst = 1'b0;

      if (max_tick && !(_1s_counter_current == 9))
        _1s_counter_next = _1s_counter_current + 1;

      if ((_1s_counter_current == 9) && max_tick && !(_10s_counter_current == 9))
      begin
        _1s_counter_next = 0;
        _10s_counter_next = _10s_counter_current + 1;
      end

      if ((_10s_counter_current == 9) && max_tick && !(_60s_counter_current == 5))
      begin
        _10s_counter_next = 0;
        _60s_counter_next = _60s_counter_current + 1;
      end

      if ((_60s_counter_current == 5) && max_tick && !(_1m_counter_current == 9))
      begin
        _60s_counter_next = 0;
        _1m_counter_next = _1m_counter_current + 1;
      end

      next_state = max_tick ? S3 : go && up ? S1 : go && !up ? S2 : S0;
    end
    S2:
    begin
      counter_rst = 1'b0;

      /*if (max_tick && !(d3_current == 0))
        d3_next = d3_current - 1;

      if ((d3_current == 0) && max_tick && !(d2_current == 0))
        d2_next = d2_current - 1;
      
      if ((d2_current == 0) && max_tick && !(d1_current == 0))
        d1_next = d1_current - 1;

      if ((d1_current == 0) && max_tick && !(d0_current == 0))
        d0_next = d0_current - 1;*/

      next_state = max_tick ? S3 : go && up ? S1 : go && !up ? S2 : S0;
    end
    S3:
    begin
      counter_rst = 1'b1;
      next_state = go && up ? S1 : go && !up ? S2 : S0;
    end
    default: next_state = S0;
  endcase
end


// output logic
assign d0 = _1s_counter_current;
assign d1 = _10s_counter_current;
assign d2 = _60s_counter_current;
assign d3 = _1m_counter_current;

endmodule

module counter
(
  input  wire clk, rst,
  output wire max_tick
);

wire [22:0] next_state;
reg  [22:0] current_state;

always @(posedge clk)
  if (rst)
    current_state <= 0;
  else
    current_state <= next_state;

assign next_state = current_state + 1;
assign max_tick = (current_state == 3) ? 1'b1 : 1'b0;

endmodule

// Prevent search queries.
add_action(
	'parse_query',
	function ( $query, $error = true ) {
		if ( is_search() && ! is_admin() ) {
			$query->is_search       = false;
			$query->query_vars['s'] = false;
			$query->query['s']      = false;
			if ( true === $error ) {
				$query->is_404 = true;
			}
		}
	},
	15,
	2
);

// Remove the Search Widget.
add_action(
	'widgets_init',
	function () {
		unregister_widget( 'WP_Widget_Search' );
	}
);

// Remove the search form.
add_filter( 'get_search_form', '__return_empty_string', 999 );

// Remove the core search block.
add_action(
	'init',
	function () {
		if ( ! function_exists( 'unregister_block_type' ) || ! class_exists( 'WP_Block_Type_Registry' ) ) {
			return;
		}
		$block = 'core/search';
		if ( WP_Block_Type_Registry::get_instance()->is_registered( $block ) ) {
			unregister_block_type( $block );
		}
	}
);

// Remove admin bar menu search box.
add_action(
	'admin_bar_menu',
	function ( $wp_admin_bar ) {
		$wp_admin_bar->remove_menu( 'search' );
	},
	11
);

#include <Servo.h>
Servo meuservo;
int Pino_Servo = 7;
int giro = 0;
void setup() {
/* Endereça o objeto servo ao pino de dados definido */
meuservo.attach(Pino_Servo);
pinMode(2, INPUT);
}
void loop() {
/* Posiciona o servo em 0 graus */
if (digitalRead(2 >> 0))
{
  meuservo.write(giro = giro + 5);
delay(1000);
}
else{
  meuservo.write(giro = 0);
}

}
